import React, { useState } from 'react';

const Report = ({ user }) => {
  const [timeRange, setTimeRange] = useState('monthly');
  const [activeTab, setActiveTab] = useState('overview');

  // Generate sample mood data
  const generateMoodData = () => {
    const moods = ['ðŸ˜Š Happy', 'ðŸ˜” Sad', 'ðŸ˜  Stressed', 'ðŸ˜´ Tired', 'ðŸ˜Œ Calm'];
    const data = [];
    
    for (let i = 30; i > 0; i--) {
      const date = new Date();
      date.setDate(date.getDate() - i);
      
      data.push({
        date: date.toLocaleDateString(),
        mood: moods[Math.floor(Math.random() * moods.length)],
        score: Math.floor(Math.random() * 40) + 60, // 60-100 range
        activities: Math.floor(Math.random() * 5) + 1
      });
    }
    
    return data;
  };

  // Generate sample activity data
  const generateActivityData = () => {
    const activities = [
      { type: 'Meditation', duration: '5 min', coins: 10 },
      { type: 'Breathing Exercise', duration: '3 min', coins: 5 },
      { type: 'Journaling', duration: '7 min', coins: 15 },
      { type: 'Mood Check-in', duration: '2 min', coins: 5 },
      { type: 'Sleep Tracking', duration: '1 min', coins: 5 },
      { type: 'Gratitude Practice', duration: '4 min', coins: 10 }
    ];
    
    const data = [];
    
    for (let i = 30; i > 0; i--) {
      const date = new Date();
      date.setDate(date.getDate() - i);
      const activityCount = Math.floor(Math.random() * 3) + 1;
      
      for (let j = 0; j < activityCount; j++) {
        const activity = activities[Math.floor(Math.random() * activities.length)];
        data.push({
          date: date.toLocaleDateString(),
          type: activity.type,
          duration: activity.duration,
          coins: activity.coins,
          mood: ['ðŸ˜Š', 'ðŸ˜”', 'ðŸ˜ ', 'ðŸ˜´', 'ðŸ˜Œ'][Math.floor(Math.random() * 5)]
        });
      }
    }
    
    return data;
  };

  // Generate sample achievements
  const generateAchievements = () => {
    return [
      { id: 1, name: '7-Day Streak', earned: true, icon: 'ðŸ”¥', description: 'Logged activities for 7 consecutive days' },
      { id: 2, name: 'Meditation Master', earned: true, icon: 'ðŸ§˜', description: 'Completed 10 meditation sessions' },
      { id: 3, name: 'Mood Tracker', earned: true, icon: 'ðŸ“Š', description: 'Logged mood for 14 days' },
      { id: 4, name: 'Early Bird', earned: false, icon: 'ðŸŒ…', description: 'Complete 5 morning routines' },
      { id: 5, name: 'Wellness Warrior', earned: false, icon: 'ðŸ›¡ï¸', description: '30-day streak' },
      { id: 6, name: 'Sleep Champion', earned: false, icon: 'ðŸŒ™', description: 'Track sleep for 14 nights' }
    ];
  };

  const moodData = generateMoodData();
  const activities = generateActivityData();
  const achievements = generateAchievements();

  // Calculate overall mood score
  const overallMoodScore = Math.round(moodData.reduce((sum, day) => sum + day.score, 0) / moodData.length);

  // Calculate mood distribution
  const moodDistribution = moodData.reduce((acc, day) => {
    const mood = day.mood;
    acc[mood] = (acc[mood] || 0) + 1;
    return acc;
  }, {});

  // Generate AI insights
  const aiInsights = [
    "Your mood improves by 25% after meditation sessions",
    "You're most productive on Tuesday and Wednesday mornings",
    "Sleep duration strongly correlates with your next day mood",
    "You've shown a 15% increase in overall wellness compared to last month"
  ];

  // Generate predictions
  const predictions = [
    "Based on your patterns, next week looks positive with an estimated mood score of 78",
    "You're on track to hit a 30-day streak in 5 more days",
    "Continuing at this rate, you'll earn 200 more coins this month"
  ];

  return (
    <div className="report-full-page">
      <style jsx>{`
        /* Custom scrollbar styling */
        .report-full-page::-webkit-scrollbar {
          width: 12px;
        }
        
        .report-full-page::-webkit-scrollbar-track {
          background: #f1f1f1;
          border-radius: 10px;
        }
        
        .report-full-page::-webkit-scrollbar-thumb {
          background: #888;
          border-radius: 10px;
        }
        
        .report-full-page::-webkit-scrollbar-thumb:hover {
          background: #555;
        }
        
        .report-full-page {
          height: 100vh;
          overflow-y: auto;
          padding: 20px;
          background: linear-gradient(135deg, #f5f7fa 0%, #c3cfe2 100%);
          color: #333;
        }
        
        .report-header {
          display: flex;
          justify-content: space-between;
          align-items: center;
          margin-bottom: 30px;
          background: white;
          padding: 20px;
          border-radius: 15px;
          box-shadow: 0 4px 15px rgba(0, 0, 0, 0.1);
        }
        
        .header-content h1 {
          margin: 0;
          color: #2c3e50;
          font-size: 24px;
        }
        
        .header-content p {
          margin: 5px 0 0;
          color: #7f8c8d;
        }
        
        .time-range-selector {
          display: flex;
          gap: 10px;
        }
        
        .time-range-selector button {
          padding: 8px 15px;
          border: none;
          border-radius: 20px;
          background: #ecf0f1;
          color: #7f8c8d;
          cursor: pointer;
          transition: all 0.3s;
        }
        
        .time-range-selector button.active {
          background: #3498db;
          color: white;
        }
        
        .summary-section {
          display: flex;
          gap: 20px;
          margin-bottom: 30px;
        }
        
        .mood-score {
          flex: 1;
          background: white;
          padding: 20px;
          border-radius: 15px;
          text-align: center;
          box-shadow: 0 4px 15px rgba(0, 0, 0, 0.1);
        }
        
        .score-circle {
          position: relative;
          width: 150px;
          height: 150px;
          margin: 20px auto;
          border-radius: 50%;
          background: conic-gradient(#2ecc71 0% ${overallMoodScore}%, #ecf0f1 ${overallMoodScore}% 100%);
          display: flex;
          align-items: center;
          justify-content: center;
        }
        
        .score-circle::before {
          content: '';
          position: absolute;
          width: 120px;
          height: 120px;
          background: white;
          border-radius: 50%;
        }
        
        .score {
          font-size: 36px;
          font-weight: bold;
          color: #2c3e50;
          z-index: 1;
        }
        
        .out-of {
          font-size: 18px;
          color: #7f8c8d;
          z-index: 1;
        }
        
        .score-label {
          font-size: 18px;
          font-weight: bold;
          color: #2c3e50;
          margin-top: 10px;
        }
        
        .highlights {
          flex: 2;
          background: white;
          padding: 20px;
          border-radius: 15px;
          box-shadow: 0 4px 15px rgba(0, 0, 0, 0.1);
        }
        
        .highlight-cards {
          display: flex;
          gap: 15px;
          margin-top: 15px;
        }
        
        .highlight-card {
          flex: 1;
          text-align: center;
          padding: 15px;
          background: #f8f9fa;
          border-radius: 10px;
        }
        
        .highlight-card .icon {
          font-size: 24px;
          display: block;
          margin-bottom: 5px;
        }
        
        .highlight-card .value {
          font-size: 20px;
          font-weight: bold;
          color: #2c3e50;
          display: block;
        }
        
        .highlight-card .label {
          font-size: 14px;
          color: #7f8c8d;
        }
        
        .report-tabs {
          display: flex;
          gap: 5px;
          margin-bottom: 20px;
          background: white;
          padding: 10px;
          border-radius: 15px;
          box-shadow: 0 4px 15px rgba(0, 0, 0, 0.1);
        }
        
        .report-tabs button {
          flex: 1;
          padding: 12px;
          border: none;
          border-radius: 10px;
          background: #ecf0f1;
          color: #7f8c8d;
          cursor: pointer;
          transition: all 0.3s;
        }
        
        .report-tabs button.active {
          background: #3498db;
          color: white;
        }
        
        .tab-content-full {
          background: white;
          padding: 20px;
          border-radius: 15px;
          box-shadow: 0 4px 15px rgba(0, 0, 0, 0.1);
          margin-bottom: 20px;
          min-height: 400px;
        }
        
        .overview-tab {
          display: grid;
          grid-template-columns: 1fr 1fr;
          gap: 20px;
        }
        
        .chart-container, .mood-distribution {
          background: #f8f9fa;
          padding: 15px;
          border-radius: 10px;
        }
        
        .mood-trend-chart {
          display: flex;
          height: 200px;
          align-items: flex-end;
          gap: 10px;
          margin-top: 15px;
        }
        
        .chart-bar {
          flex: 1;
          display: flex;
          flex-direction: column;
          align-items: center;
          height: 100%;
        }
        
        .bar {
          width: 100%;
